import styled from 'styled-components'

const wrapper = styled.button
`
    position :absolute;
    left: ${props.position ==='left' ? '20px':'380px'};
    top:320px;
    width:100px;
    height:50px;
    border-radius:10px;
    border: 1px solid black;
    cursor : pointer;

`;



function Button({callback,position,swtchOn}) {
    return (
        <wrapper  onClick={callback}  position={position}>
            {switchOn ? "On" : "Off"}
        </wrapper>    
    )
}

export default Button
